  const {showMod, handleMod} = props
  return (
    <div>
      <Modal isOpen={showMod} className="modal" overlayClassName="overlayModal">
        <h1 className='modal-close-btn' onClick={() =>handleMod(false)} > X </h1>
        <h1>KHan The Great </h1>

      </Modal>
    </div>
  );
}

export default InputModal;
